	// 2 Search dex via resistances string array method
	static func findResistances(resistTypes: [String]) -> [String] {
		var candidateList = [String]()
		// For each mon in pokedex, iterate through and check effectiveness of each listed type to check if it resists
		for mon in Dex.dexArray {
			var monWeaknessArray = mon.getPokemonWeaknesses(pokemonName: mon)
			var candidate = true
			// Each mon is a candidate by default
			// If a mon is neutral or weak to a listed type, then it is marked as not being a candidate
			for type in resistTypes {
				if monWeaknessArray[type]! > 0 {
					candidate = false
				}
			}
			// If mon is still a candidate after loop, then add it to array
			if candidate == true {
				//print(monWeaknessArray)
				candidateList += [mon.species]
			}
		}
		print(candidateList)
		return candidateList
		
	}
	
	// 3 Search dex method general
	static func searchDex(searchParam: String) -> [Pokemon] {
		var searchResults = [Pokemon]()
		// Determination of method type for string searchDex method
		let searchStringLower = searchParam.lowercased()
		// Search by Type
		if typeListLower.contains(searchStringLower) {
			for mon in Dex.dexArray {
				for type in mon.types {
					if type.lowercased() == searchStringLower {
						searchResults.append(mon)
					}
				}
			}
		} else {
			// Search by Name
			for mon in Dex.dexArray {
				if mon.species.lowercased().contains(searchStringLower) {
					searchResults.append(mon)
				}
				//search by Learnable move --- THIS NEEDS FIXING
				//				let learnset = mon.getPokemonLearnset(pokemon: mon)
				//				for move in learnset {
				//					if move.contains(searchStringLower) {
				//						searchResults.append(mon)
				//					}
				//				}
				//search by Ability
				for ability in mon.abilities {
					if ability.lowercased().contains(searchStringLower) {
						searchResults.append(mon)
					}
				}
			}
			
			
		}
		return searchResults
	}
	// Search by num
	static func searchDex(searchParam: Int) -> [Pokemon] {
		var searchResults = [Pokemon]()
		for mon in Dex.dexArray {
			if mon.num == searchParam {
				searchResults.append(mon)
			}
			// Search by BST floor
			let monBST = Pokemon.calcBST(pokemon: mon)
			if monBST <= searchParam {
				searchResults.append(mon)
			}
			
		}
		return searchResults
	}
	
