			Move(accuracy: 100, basePower: 0, category: "Status", desc: "For 3 turns, the target cannot avoid any attacks made against it, other than OHKO moves, as long as it remains active. During the effect, the target is immune to Ground-type attacks and the effects of Spikes, Toxic Spikes, Sticky Web, and the Ability Arena Trap as long as it remains active. If the target uses Baton Pass, the replacement will gain the effect. Ingrain, Smack Down, Thousand Arrows, and Iron Ball override this move if the target is under any of their effects. Fails if the target is already under this effect or the effects of Ingrain, Smack Down, or Thousand Arrows.", shortDesc: "For 3 turns, target floats but moves can't miss it.", id: "telekinesis", name: "Telekinesis", priority: 0, forceSwitch: false, target: "normal", type: "Psychic"),
			Move(accuracy: 100, basePower: 0, category: "Status", desc: "Fails when used.", shortDesc: "Flee from wild Pokemon battles.", id: "teleport", name: "Teleport", priority: 0, forceSwitch: false, target: "self", type: "Psychic"),
			Move(accuracy: 100, basePower: 60, category: "Physical", desc: "If this attack was successful and the user has not fainted, it steals the target's held item if the user is not holding one. The target's item is not stolen if it is a Mail or Z-Crystal, or if the target is a Kyogre holding a Blue Orb, a Groudon holding a Red Orb, a Giratina holding a Griseous Orb, an Arceus holding a Plate, a Genesect holding a Drive, a Silvally holding a Memory, or a Pokemon that can Mega Evolve holding the Mega Stone for its species. Items lost to this move cannot be regained with Recycle or the Ability Harvest.", shortDesc: "If the user has no item, it steals the target's.", id: "thief", name: "Thief", priority: 0, forceSwitch: false, target: "normal", type: "Dark"),
			Move(accuracy: 100, basePower: 90, category: "Physical", desc: "This move can hit airborne Pokemon, which includes Flying-type Pokemon, Pokemon with the Ability Levitate, Pokemon holding an Air Balloon, and Pokemon under the effect of Magnet Rise or Telekinesis. If the target is a Flying type and is not already grounded, this move deals neutral damage regardless of its other type(s). This move can hit a target using Bounce, Fly, or Sky Drop. If this move hits a target under the effect of Bounce, Fly, Magnet Rise, or Telekinesis, the effect ends. If the target is a Flying type that has not used Roost this turn or a Pokemon with the Ability Levitate, it loses its immunity to Ground-type attacks and the Ability Arena Trap as long as it remains active. During the effect, Magnet Rise fails for the target and Telekinesis fails against the target.", shortDesc: "Grounds adjacent foes. First hit neutral on Flying.", id: "thousandarrows", name: "Thousand Arrows", priority: 0, forceSwitch: false, target: "allAdjacentFoes", type: "Ground"),
			Move(accuracy: 100, basePower: 90, category: "Physical", desc: "Prevents the target from switching out. The target can still switch out if it is holding Shed Shell or uses Baton Pass, Parting Shot, U-turn, or Volt Switch. If the target leaves the field using Baton Pass, the replacement will remain trapped. The effect ends if the user leaves the field.", shortDesc: "Hits adjacent foes. Prevents them from switching.", id: "thousandwaves", name: "Thousand Waves", priority: 0, forceSwitch: false, target: "allAdjacentFoes", type: "Ground"),
			Move(accuracy: 100, basePower: 120, category: "Physical", desc: "Deals damage to one adjacent foe at random. The user spends two or three turns locked into this move and becomes confused after the last turn of the effect if it is not already. If the user is prevented from moving or the attack is not successful against the target on the first turn of the effect or the second turn of a three-turn effect, the effect ends without causing confusion. If this move is called by Sleep Talk, the move is used for one turn and does not confuse the user.", shortDesc: "Lasts 2-3 turns. Confuses the user afterwards.", id: "thrash", name: "Thrash", priority: 0, forceSwitch: false, target: "randomNormal", type: "Normal"),
