			Move(accuracy: 100, basePower: 0, category: "Status", desc: "Prevents the target from selecting the same move for use two turns in a row. This effect lasts until the target leaves the field.", shortDesc: "Target can't select the same move twice in a row.", id: "torment", name: "Torment", priority: 0, forceSwitch: false, target: "normal", type: "Dark"),
			Move(accuracy: 90, basePower: 0, category: "Status", desc: "Badly poisons the target. If a Poison-type Pokemon uses this move, the target cannot avoid the attack, even if the target is in the middle of a two-turn move.", shortDesc: "Badly poisons the target.", id: "toxic", name: "Toxic", priority: 0, forceSwitch: false, target: "normal", type: "Poison"),
			Move(accuracy: 100, basePower: 0, category: "Status", desc: "Sets up a hazard on the foe's side of the field, poisoning each foe that switches in, unless it is a Flying-type Pokemon or has the Ability Levitate. Can be used up to two times before failing. Foes become poisoned with one layer and badly poisoned with two layers. Can be removed from the foe's side if any foe uses Rapid Spin or Defog, is hit by Defog, or a grounded Poison-type Pokemon switches in. Safeguard prevents the foe's party from being poisoned on switch-in, but a substitute does not.", shortDesc: "Poisons grounded foes on switch-in. Max 2 layers.", id: "toxicspikes", name: "Toxic Spikes", priority: 0, forceSwitch: false, target: "foeSide", type: "Poison"),
