			Move(accuracy: 100, basePower: 0, category: "Status", desc: "The user transforms into the target. The target's current stats, stat stages, types, moves, Ability, weight, gender, and sprite are copied. The user's level and HP remain the same and each copied move receives only 5 PP, with a maximum of 5 PP each. The user can no longer change formes if it would have the ability to do so. This move fails if the target has a substitute, if either the user or the target is already transformed, or if either is behind an Illusion.", shortDesc: "Copies target's stats, moves, types, and Ability.", id: "transform", name: "Transform", priority: 0, forceSwitch: false, target: "normal", type: "Normal"),
