			Move(accuracy: 100, basePower: 0, category: "Status", desc: "Causes the Ghost type to be added to the target, effectively making it have two or three types. Fails if the target is already a Ghost type. If Forest's Curse adds a type to the target, it replaces the type added by this move and vice versa.", shortDesc: "Adds Ghost to the target's type(s).", id: "trickortreat", name: "Trick-or-Treat", priority: 0, forceSwitch: false, target: "normal", type: "Ghost"),
