			Move(accuracy: 90, basePower: 10, category: "Physical", desc: "Hits three times. Power increases to 20 for the second hit and 30 for the third. This move checks accuracy for each hit, and the attack ends if the target avoids any of the hits. If one of the hits breaks the target's substitute, it will take damage for the remaining hits. If the user has the Ability Skill Link, this move will always hit three times.", shortDesc: "Hits 3 times. Each hit can miss, but power rises.", id: "triplekick", name: "Triple Kick", priority: 0, forceSwitch: false, target: "normal", type: "Fighting"),
