			Move(accuracy: 100, basePower: 70, category: "Physical", desc: "If this move is successful and the user has not fainted, the user switches out even if it is trapped and is replaced immediately by a selected party member. The user does not switch out if there are no unfainted party members, or if the target switched out using an Eject Button.", shortDesc: "User switches out after damaging the target.", id: "uturn", name: "U-turn", priority: 0, forceSwitch: false, target: "normal", type: "Bug"),
