			Move(accuracy: 100, basePower: 50, category: "Special", desc: "Power doubles during weather effects and this move's type changes to match; Ice type during Hail, Water type during Rain Dance, Rock type during Sandstorm, and Fire type during Sunny Day.", shortDesc: "Power doubles and type varies in each weather.", id: "weatherball", name: "Weather Ball", priority: 0, forceSwitch: false, target: "normal", type: "Normal"),
			Move(accuracy: 85, basePower: 35, category: "Special", desc: "Prevents the target from switching for four or five turns; seven turns if the user is holding Grip Claw. Causes damage to the target equal to 1/8 of its maximum HP (1/6 if the user is holding Binding Band), rounded down, at the end of each turn during effect. The target can still switch out if it is holding Shed Shell or uses Baton Pass, Parting Shot, U-turn, or Volt Switch. The effect ends if either the user or the target leaves the field, or if the target uses Rapid Spin or Substitute. This effect is not stackable or reset by using this or another partial-trapping move.", shortDesc: "Traps and damages the target for 4-5 turns.", id: "whirlpool", name: "Whirlpool", priority: 0, forceSwitch: false, target: "normal", type: "Water"),
