			Move(accuracy: 100, basePower: 0, category: "Status", desc: "The user and its party members are protected from moves made by other Pokemon, including allies, during this turn that target all adjacent foes or all adjacent Pokemon. This move modifies the same 1/X chance of being successful used by other protection moves, where X starts at 1 and triples each time this move is successfully used, but does not use the chance to check for failure. X resets to 1 if this move fails or if the user's last move used is not Baneful Bunker, Detect, Endure, King's Shield, Protect, Quick Guard, Spiky Shield, or Wide Guard. Fails if the user moves last this turn or if this move is already in effect for the user's side.", shortDesc: "Protects allies from multi-target moves this turn.", id: "wideguard", name: "Wide Guard", priority: 3, forceSwitch: false, target: "allySide", type: "Rock"),
			Move(accuracy: 100, basePower: 90, category: "Physical", desc: "If the target lost HP, the user takes recoil damage equal to 1/4 the HP lost by the target, rounded half up, but not less than 1 HP.", shortDesc: "Has 1/4 recoil.", id: "wildcharge", name: "Wild Charge", priority: 0, forceSwitch: false, target: "normal", type: "Electric"),
